import logoAdmin from "@assets/images/logo-admin.png";
import Navbar from "@layoutStore/navbar";
import { FaBell ,FaRegSun, FaUsers} from "react-icons/fa";




const HomePage = () => {
  return (
    <div className="w-[100vw] h-[100vh] relative">
      <div className="navbar w-[100vw] h-[15%] bg-[#394449] shadow-2xl absolute">
        <div className="right-0 absolute flex flex-row-reverse gap-x-10 text-[40px] items-center top-[30%] pr-16">
            <div className="users">
            <FaUsers />
            </div>
            <div className="icon flex gap-x-16">
            <FaBell />
            <FaRegSun />
            </div>
            <input type="text" className="w-[450px] h-[30px] p-5 text-[18px] outline-none bg-[#2d3a41] roun"/>
        </div>
      </div>
      <div className="navbar w-[15%] h-[100vh] bg-[#394449] shadow-2xl absolute z-50">
        <div className="logo">
          <img src={logoAdmin} alt="" />
        </div>
        <Navbar></Navbar>
      </div>
    </div>
  );
};
export default HomePage;
